const npcFocus = ["current scene", "a story, allegory, or metaphor", "other NPC flaws", "equipment", "a character's family", "ancient history", "retainers", "wealth", "a relic", "a skill", "their superiors", "an adventure hook", "character's reputation", "the campaign", "their enemy", "a NPC need", "a new rumor", "a discovered secret", "a future action", "friends", "allies", "a contact to seek out", "their flaws", "an antagonist", "rewards owed", "an experience", "knowledge needed", "a recent event", "a specific community", "treasure", "a character", "the current adventure", "a character's flaw", "their family", "power", "weapons", "a previous event", "a common enemy"];

const mainStat = ["Strength", "Constitution", "Dexterity", "Wisdom", "Intelligence","Charisma"];

function d100() {
    return dN(100);
}

function d100ReRollMod20(r100, s100) {
    return dNReRollMod20(100, r100, s100)
}

function dNReRollMod20(length, r100, s100) {
    let v100 = dN(length);
    if (Math.floor(r100 / 20) == Math.floor(v100 / 20) || Math.floor((s100 ?? r100) / 20) == Math.floor(v100 / 20)) {
        v100 = d100ReRollMod20(length, r100, s100);
    }
    return v100;
}

function d10() {
    return dN(10);
}

function getComparablePowerLevel(r100, npcLevel) {
    if (npcLevel.muchWeaker >= r100 + 1) return 'Much Weaker than';
    if (npcLevel.slightlyWeaker >= r100 + 1) return 'Slightly Weaker than';
    if (npcLevel.comparable >= r100 + 1) return 'Similar Strength to';
    if (npcLevel.slightlyStronger >= r100 + 1) return 'Slightly Stronger than';
    if (npcLevel.muchStronger >= r100 + 1) return 'Much Stronger than';
    return 'Unknown'
}

function getMood(roll, feeling) {

    if (feeling.withdrawn >= roll + 1) return 'Withdrawn';
    if (feeling.guarded >= roll + 1) return 'Guarded';
    if (feeling.cautious >= roll + 1) return 'Cautious';
    if (feeling.neutral >= roll + 1) return 'Neutral';
    if (feeling.sociable >= roll + 1) return 'Sociable';
    if (feeling.helpful >= roll + 1) return 'Helpful';
    if (feeling.forthcoming >= roll + 1) return 'Forthcoming';
    return 'Unknown'
}

function d8() {
    return dN(8);
}

function dN(num) {
    const val= Math.floor(Math.random() * num);
    console.log("roll: d"+num + ' =' + val );
    return val;
}

function getBearing(bL, bT) {
    const levelIdx = bL ?? d8()
    const typeIdx = bT ?? d10();
    return {lId: levelIdx, tId: typeIdx, level: npcBearing[levelIdx].level, type: npcBearing[levelIdx].type[typeIdx]}
}

function getFocus(fIdx) {
    const focusIdx = fIdx ?? dN(npcFocus.length);
    return {id: focusIdx, label: npcFocus[focusIdx]}
}

function getPlace(idx) {
    const placeIdx = idx ?? dN(places.length);
    return {id: placeIdx, label: places[placeIdx]}
}

function getName(idx) {
    const nameIdx = idx ?? dN(names.length);
    return {id: nameIdx, label: names[nameIdx]}
}

function getPowerLevel(pl, pt) {
    const level = pl ? Number.parseInt(pl) :  dN(5)
    const npcLevel = npcPowerLevel[level];
    const r100 = pt ? Number.parseInt(pt) :  d100();

    return {id: level, pId: r100, level: npcLevel.level, strength: getComparablePowerLevel(r100, npcLevel)}
}

function getFavor(fl, flm) {
    const level = fl ? Number.parseInt(fl) :  dN(conversationMood.length)
    const npcLevel = conversationMood[level];
    const r100 = flm ? Number.parseInt(flm) :  d100();

    return {id: level, mId: r100, level: npcLevel.level, mood: getMood(r100, npcLevel)}
}


function getMotivations(n1, n2, n3, v1, v2, v3) {
    const mNoun1Idx = n1 ? Number.parseInt(n1) : dN(npcMotivationNoun.length);
    const mNoun2Idx = n2 ? Number.parseInt(n2) : dNReRollMod20(npcMotivationNoun.length, mNoun1Idx);
    const mNoun3Idx = n3 ? Number.parseInt(n3) : dNReRollMod20(npcMotivationNoun.length, mNoun1Idx, mNoun2Idx);

    const verb1Idx = v1 ? Number.parseInt(v1) : dN(npcMotivationVerb.length);
    const verb2Idx = v2 ? Number.parseInt(v2) : dNReRollMod20(npcMotivationVerb.length, verb1Idx);
    const verb3Idx = v3 ? Number.parseInt(v3) : dNReRollMod20(npcMotivationVerb.length, verb1Idx, verb2Idx);

    return [{
        id: mNoun1Idx, vId: verb1Idx, motivation: npcMotivationVerb[verb1Idx], noun: npcMotivationNoun[mNoun1Idx]
    }, {
        id: mNoun2Idx, vId: verb2Idx, motivation: npcMotivationVerb[verb2Idx], noun: npcMotivationNoun[mNoun2Idx]
    }, {id: mNoun3Idx, vId: verb3Idx, motivation: npcMotivationVerb[verb3Idx], noun: npcMotivationNoun[mNoun3Idx]}]
}

function buildUrl(npc) {
    console.log(npc);
    let params = [];
    params.push({id: 'm', value: npc.modifier.mIdx});
    params.push({id: 'n', value: npc.noun.nIdx});
    params.push({id: 'mn1', value: npc.motivations[0].id});
    params.push({id: 'mn2', value: npc.motivations[1].id});
    params.push({id: 'mn3', value: npc.motivations[2].id});
    params.push({id: 'mv1', value: npc.motivations[0].vId});
    params.push({id: 'mv2', value: npc.motivations[1].vId});
    params.push({id: 'mv3', value: npc.motivations[2].vId});
    params.push({id: 'pl', value: npc.powerLevel.id});
    params.push({id: 'pt', value: npc.powerLevel.pId});
    params.push({id: 'bl', value: npc.discussion.bearing.lId});
    params.push({id: 'bt', value: npc.discussion.bearing.tId});
    params.push({id: 'f', value: npc.discussion.focus.id});
    params.push({id: 'na', value: npc.name.id});
    params.push({id: 'pla', value: npc.place.id});
    params.push({id: 'fl', value: npc.favor.id});
    params.push({id: 'flm', value: npc.favor.mId});
    params.push({id: 'st', value: npc.ability.id});

    return params.map(p => p.id + '=' + p.value).join('&')
}

function getPrimaryAbility(param) {
    const statIdx = param ? Number.parseInt(param) : dN(mainStat.length);
    return {id: statIdx, label:mainStat[statIdx]}
}


function generate(params) {
    const npcM = params?.get('m') ?? d100();
    const npcN = params?.get('n') ?? d100();
    const npcMN1 = params?.get('mn1');
    const npcMN2 = params?.get('mn2');
    const npcMN3 = params?.get('mn3');
    const npcMV1 = params?.get('mv1');
    const npcMV2 = params?.get('mv2');
    const npcMV3 = params?.get('mv3');
    const npcPL = params?.get('pl');
    const npcPT = params?.get('pt');
    const npcBL = params?.get('bl');
    const npcBT = params?.get('bt');
    const npcF = params?.get('f');
    const npcNA = params?.get('na');
    const npcPLA = params?.get('pla');
    const npcFL = params?.get('fl');
    const npcFLM = params?.get('flm');
    const npcST = params?.get('st');



    let npc = {
        name: getName(npcNA),
        place: getPlace(npcPLA),
        modifier: {mIdx: npcM, label: npcModifier[npcM]},
        noun: {nIdx: npcN, label: npcNoun[npcN]},
        powerLevel: getPowerLevel(npcPL, npcPT),
        favor: getFavor(npcFL, npcFLM),
        motivations: getMotivations(npcMN1, npcMN2, npcMN3, npcMV1, npcMV2, npcMV3),
        ability: getPrimaryAbility(npcST),
        discussion: {
            bearing: getBearing(npcBL, npcBT), focus: getFocus(npcF)
        }
    };
    npc.url = buildUrl(npc)
    return npc;
}

function shuffle(items) {
    return items
        .map((value) => ({value, sort: Math.random()}))
        .sort((a, b) => a.sort - b.sort)
        .map(({value}) => value)
}

document.addEventListener('alpine:init', () => {
    Alpine.data('app', () => ({
        generating: false, get params() {
            return new URLSearchParams(location.search)
        }, npc: generate(new URLSearchParams(location.search)), go() {
            document.getElementById('no-whammy').play()
            this.generating = setInterval(() => this.npc = generate(), 150)
            setTimeout(() => {
                clearInterval(this.generating)
                this.generating = false
            }, 5150)
        },
    }))
})
